  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Fish Springs
  National Wildlife Refuge outlines Refuge accomplishments from September through
  December of 1963. The report begins by summarizing the weather conditions, habitat
  conditions, water conditions, and food and cover during this period. Wildlife- including
  migratory birds, big game animals, furbearers, predators, rodents, mammals, raptors,
  reptiles, and disease- is also covered. The Refuge development and maintenance section
  discusses physical developments, plantings, collections and receipts, and vegetation
  control. Resource management is outlined; topics include peat mining, and frog farming.
  A progress report on field investigations and applied research is also provided.
  The public relations section of the report describes recreational uses, Refuge visitors,
  hunting, violations, and safety. Items of interest, N-R forms, and photographs are
  attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
